import React from 'react'

export default function ContactForm() {
    return (
        <div className='contacts main-font'>
            <div className='text-center'>

                <h1>Contact Me!</h1>
                <p>Please fill out the form below, and I'll get back to you ASAP!</p>

            </div>
        </div>
    )
}
